import { Route } from 'react-router-dom';
import './App.css';

import HomePage from './pages/homepage/homepage.component';

const HatPage = () => (
  <div>
    <h1> Hats Page</h1>
  </div>
)

function App() {
  return (
    <div>
      <Route exact path='/' component={Homepage} />
      <Route exact path='/hats' component={Hate} />
    </div>
  );
}

export default App;
